import style from './ProfileStatus.module.css'


let ProfileStatus = (props) => {

    return(
        <div>
            <div>
                <span>
                    {props.status}
                </span>
            </div>
            <div>
                <input value={props.status}/>
            </div>
        </div>

    )
}

export default ProfileStatus;
